import React from 'react';
import logo from './logo.svg';
import {Provider,Grid,View,defaultTheme,Form,TextField,Checkbox,Link,Button} from '@adobe/react-spectrum';
import './App.css';

function App() {
  return (
    <div className="App">
      <Provider theme={defaultTheme}>
      <Form maxWidth="size-3600">
        <TextField label="Email" placeholder="abc@adobe.com" />
        <TextField label="Password" placeholder="1234" />
        <Checkbox>Remember me</Checkbox>
        <Link>
          <a href="#" target="_blank"> Forgot Password?</a>
        </Link>
        <Button variant="cta">Login</Button>
        <Link>
          <span></span><a href="#" target="_blank"> Forgot Password?</a>
        </Link>
      </Form>
      </Provider>
    </div>
  );
}

export default App;
